import React, { useState } from "react";
import NavBar from "../home/NavBar";

import Form from "../home/Form";
import Footer from "../home/Footer";

const dataNavbarMenu = [
  {
    type: "Stays",
    icon: "fa-bed",
    active: true,
  },
  {
    type: "Flights",
    icon: "fa-plane",
    active: false,
  },
  {
    type: "Car rentals",
    icon: "fa-car",
    active: false,
  },
  {
    type: "Attractions",
    icon: "fa-bed",
    active: false,
  },
  {
    type: "Airport taxis",
    icon: "fa-taxi",
    active: false,
  },
];

const Search = (props) => {
  return (
    <>
      <div className="container bg-blue">
        <NavBar dataNavbarMenu={dataNavbarMenu} />
      </div>
      <div className="container bg-blue">
        <Header />
      </div>
      <div className="container">
        <Body dataCity={dataCity} dataType={dataType} dataHotel={dataHotel} />
      </div>
      <div className="container bg-blue">
        <Form />
      </div>
      <div className="container">
        <Footer dataFooter={dataFooter} />
      </div>
    </>
  );
};

export default Search;
